1459	La quantit de sperme d'une jaculation peut tre contenue dans ... ?	La quantit de sperme mis lors d'une jaculation tient  peu prs dans une cuillre  caf. La quantit de sperme mis ne dtermine pas le plaisir reu ou donn. Plus les jaculations sont rapproches, plus la quantit diminue et le sperme devient transparent : c'est normal. Attention, une goutte suffit pour transmettre une infection ou provoquer une grossesse.	\N	\N	2021-06-29 15:42:33.266+02	\N	\N	2021-06-29 15:42:33.268+02	2021-06-29 15:42:33.284+02	\N	37
1460	Jamais envie de rapports sexuels... c'est possible ?	Oui. Certaines personnes n'ont juste pas envie et c'est tout  fait possible et normal (on appelle a l'asexualit). Il peut aussi s'agir d'autres raisons : pas le bon moment, pas la bonne personne, aprs une exprience traumatisante, manque de libido, le stress, etc. : si tu en ressens le besoin, tu peux consulter une professionnelle de sant.	\N	\N	2021-06-29 15:42:33.472+02	\N	\N	2021-06-29 15:42:33.475+02	2021-06-29 15:42:33.495+02	\N	37
1461	Est-ce qu'il faut se raser les poils autour du sexe ?	Non, il ne faut pas forcment se raser les poils autour du sexe. S'piler est un <strong>choix personnel</strong> et ce n'est pas plus hyginique. L'hygine n'a rien  voir avec les poils. En dehors de l'hygine intime, celle du corps, celle des mains, qui sont recommandes : chacune fait ce qu'ilelle veut avec ses poils !	\N	\N	2021-06-29 15:42:33.666+02	\N	\N	2021-06-29 15:42:33.671+02	2021-06-29 15:42:33.691+02	\N	37
1462	L'hymen, c'est quoi ?	"L'hymen est une petite membrane de forme et d'paisseur variables qui ferme plus ou moins partiellement le vagin. 3 infos  retenir :\r\n- 1/3 des femmes n'ont jamais eu d'hymen. \r\n- Cette membrane peut s'assouplir et s'ouvrir davantage lors des premiers rapports sexuels (ou pas). \r\n- Il n'y a pas forcment de sang lors d'une premire pntration vaginale.	\N	\N	2021-06-29 15:42:33.862+02	\N	\N	2021-06-29 15:42:33.866+02	2021-06-29 15:42:33.887+02	\N	37
1463	Il peut arriver d'jaculer du sperme de manire incontrle la nuit ?	Le sperme peut parfois sortir de manire incontrle souvent durant le sommeil (a peut arriver la journe mais plus rarement). On appelle cela l'jaculation nocturne (ou le  rve mouill ). a tmoigne souvent du dbut de la pubert et c'est frquent chez l'ado. a existe aussi parfois chez l'adulte. C'est un phnomne tout  fait normal, et ce n'est pas sale.	\N	\N	2021-06-29 15:42:34.025+02	\N	\N	2021-06-29 15:42:34.027+02	2021-06-29 15:42:34.04+02	\N	37
1464	La loi interdit d'avoir des rapports sexuels avant 15 ans ?	Non, il n'y a pas d'ge lgal : deux mineures peuvent librement avoir des rapports sexuels entre euxelles. Cependant, une majeure qui aurait des rapports sexuels avec une mineure de moins de 15 ans, et ce, mme si lela mineure consent  l'acte ou au rapport sexuel, peut tre condamne car a constitue une atteinte sexuelle sur mineure.	\N	\N	2021-06-29 15:42:34.176+02	\N	\N	2021-06-29 15:42:34.178+02	2021-06-29 15:42:34.189+02	\N	37
1465	Une personne qui force sa partenaire enceinte  avorter, c'est illgal ?	Oui, il est interdit de forcer une femme, mineure ou majeure,  avorter. La dcision finale n'appartient qu' la femme enceinte. Le partenaire est l pour conseiller mais ne peut pas faire pression. Pratiquer une interruption de grossesse sans le consentement de la femme enceinte peut tre puni de cinq ans d'emprisonnement et de 75 000 euros d'amende.	\N	\N	2021-06-29 15:42:34.344+02	\N	\N	2021-06-29 15:42:34.346+02	2021-06-29 15:42:34.359+02	\N	41
1466	Pour une fille, aprs un passage aux toilettes, il vaut mieux s'essuyer... ?	En se nettoyant de l'avant vers l'arrire, la personne vite la propagation de matires fcales vers la vulve, donc la propagation d'infections potentielles. D'autres petits conseils : ne pas pratiquer les douches vaginales (nettoyage de l'intrieur du vagin) car le vagin est auto-nettoyant et utiliser un savon sans parfum pour l'extrieur (la vulve).	\N	\N	2021-06-29 15:42:34.521+02	\N	\N	2021-06-29 15:42:34.523+02	2021-06-29 15:42:34.537+02	\N	37
